export default function Rodape(){
    return(
        <main>
            <img className="ondulacao" src="../../../images/ondulação.png"></img>
            <div className="rodapé">
                <h4>Nos siga nas<span style="colo">redes sociais</span></h4>
                <hr className="linha"></hr>
                <div className="icons">
                    <img src="../../../images/insta.png"></img>
                    <img src="../../../images/face.png"></img>
                    <img src="../../../images/whats.png"></img></div>
            </div>
        </main>
    )
}
